import React from 'react';
import PropTypes from 'prop-types';
import { Route, Switch } from 'react-router-dom';
import MainDotNet from './DotNet/MainDotNet';
import MainReact from './React/MainReact';
import Menu from './Menu/Menu';
import SubMenu from './SubMenu/SubMenu';

Docs.propTypes = {

};

function Docs(props) {

    
    const isCheck = useSelector(state => state.Check.isCheck)

    let isTitle = ''
    let isContent = ''

    if (isCheck){
        isTitle = 'pt-2 h4_bold text_night'
        isContent = 'pt-1 text_night'
    }else{
        isTitle = 'pt-2 h4_bold text_day'
        isContent = 'pt-1 text_day'
    }

    return (
        <div className="main_wrapper">
                <div className="row_wrapper">
                    <div className="grid_left">

                    </div>
                    <div className="grid_right">
                        <div className="col_content">
                            <Switch>

                                <Route exact path='/react-document/docs/dotnet' component={MainDotNet} />
                                <Route path='/react-document/docs/react' component={MainReact} />

                            </Switch>
                        </div>
                        <div className="col_submenu">

                        </div>
                    </div>
                </div>
        </div>


    );
}

export default Docs;
